(1229, '_transient_wp_job_manager_addons_html', '<ul class="products"><li class="first post-1059 product type-product status-publish has-post-thumbnail product_cat-core-add-ons product_cat-forms product_cat-functionality pa_license-developer pa_license-personal virtual sold-individually taxable shipping-taxable purchasable product-type-variable product-cat-core-add-ons product-cat-forms product-cat-functionality has-default-attributes has-children instock">\n	<a href="https://wpjobmanager.com/add-ons/applications/">\n	</a><a href="https://wpjobmanager.com/add-ons/applications/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2014/06/applications.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="applications" /></a>\n\n	<h2>\n	<span class="price"><span class="amount">$39</span></span>\n <a href="https://wpjobmanager.com/add-ons/applications/">Applications</a></h2>\n\n	<p>Allow candidates to apply to jobs using a form &amp; employers to view and manage the applications from their job dashboard.</p>\n</li>\n				\n					<li class="post-56 product type-product status-publish has-post-thumbnail product_cat-core-add-ons product_cat-selling pa_license-developer pa_license-personal virtual sold-individually taxable shipping-taxable purchasable product-type-variable product-cat-core-add-ons product-cat-selling has-default-attributes has-children instock">\n	<a href="https://wpjobmanager.com/add-ons/wc-paid-listings/">\n	</a><a href="https://wpjobmanager.com/add-ons/wc-paid-listings/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2014/02/wc_paid_small1.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="wc_paid_small1" /></a>\n\n	<h2>\n	<span class="price"><span class="amount">$39</span></span>\n <a href="https://wpjobmanager.com/add-ons/wc-paid-listings/">WC Paid Listings</a></h2>\n\n	<p>Paid listing functionality powered by WooCommerce. Create custom job packages which can be purchased or redeemed during job submission. Requires the WooCommerce plugin.</p>\n</li>\n				\n					<li class="last post-59 product type-product status-publish has-post-thumbnail product_cat-core-add-ons product_cat-functionality pa_license-developer pa_license-personal virtual sold-individually taxable shipping-taxable purchasable product-type-variable product-cat-core-add-ons product-cat-functionality has-default-attributes has-children instock">\n	<a href="https://wpjobmanager.com/add-ons/resume-manager/">\n	</a><a href="https://wpjobmanager.com/add-ons/resume-manager/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2014/02/resume-small.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="resume-small" /></a>\n\n	<h2>\n	<span class="price"><span class="amount">$39</span></span>\n <a href="https://wpjobmanager.com/add-ons/resume-manager/">Resume Manager</a></h2>\n\n	<p>Resume Manager is a plugin built on top of WP Job Manager which adds a resume submission form to your site and resume listings, all manageable from WordPress admin.</p>\n</li>\n				\n					<li class="first post-8123 product type-product status-publish has-post-thumbnail product_cat-core-add-ons product_cat-functionality pa_license-developer pa_license-personal virtual sold-individually taxable shipping-taxable purchasable product-type-variable product-cat-core-add-ons product-cat-functionality has-default-attributes has-children instock">\n	<a href="https://wpjobmanager.com/add-ons/apply-with-facebook/">\n	</a><a href="https://wpjobmanager.com/add-ons/apply-with-facebook/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2015/03/facebook.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="facebook" /></a>\n\n	<h2>\n	<span class="price"><span class="amount">$19</span></span>\n <a href="https://wpjobmanager.com/add-ons/apply-with-facebook/">Apply with Facebook</a></h2>\n\n	<p>Allow candidates to apply to jobs via email using their Facebook profile.</p>\n</li>\n				\n					<li class="post-5046 product type-product status-publish has-post-thumbnail product_cat-core-add-ons product_cat-functionality pa_license-developer pa_license-personal virtual sold-individually taxable shipping-taxable purchasable product-type-variable product-cat-core-add-ons product-cat-functionality has-default-attributes has-children instock">\n	<a href="https://wpjobmanager.com/add-ons/apply-xing/">\n	</a><a href="https://wpjobmanager.com/add-ons/apply-xing/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2014/12/xinglogo.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="xinglogo" /></a>\n\n	<h2>\n	<span class="price"><span class="amount">$19</span></span>\n <a href="https://wpjobmanager.com/add-ons/apply-xing/">Apply with XING</a></h2>\n\n	<p>Allow candidates to apply to jobs via email using their XING profile.</p>\n</li>\n				\n					<li class="last post-730 product type-product status-publish has-post-thumbnail product_cat-core-add-ons product_cat-functionality pa_license-developer pa_license-personal virtual sold-individually taxable shipping-taxable purchasable product-type-variable product-cat-core-add-ons product-cat-functionality has-default-attributes has-children instock">\n	<a href="https://wpjobmanager.com/add-ons/bookmarks/">\n	</a><a href="https://wpjobmanager.com/add-ons/bookmarks/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2014/06/bookmarks1.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="bookmarks" /></a>\n\n	<h2>\n	<span class="price"><span class="amount">$19</span></span>\n <a href="https://wpjobmanager.com/add-ons/bookmarks/">Bookmarks</a></h2>\n\n	<p>Allow logged in candidates and employers to bookmark jobs and resumes along with an added note.</p>\n</li>\n				\n					<li class="first post-61 product type-product status-publish has-post-thumbnail product_cat-core-add-ons product_cat-functionality pa_license-developer pa_license-personal virtual sold-individually taxable shipping-taxable purchasable product-type-variable product-cat-core-add-ons product-cat-functionality has-default-attributes has-children instock">\n	<a href="https://wpjobmanager.com/add-ons/job-alerts/">\n	</a><a href="https://wpjobmanager.com/add-ons/job-alerts/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2014/02/job_alerts_icon-318x222.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="job_alerts_icon-318x222" /></a>\n\n	<h2>\n	<span class="price"><span class="amount">$29</span></span>\n <a href="https://wpjobmanager.com/add-ons/job-alerts/">Job Alerts</a></h2>\n\n	<p>Allow registered users to save their job searches and create alerts which send new jobs via email daily, weekly or fortnightly.</p>\n</li>\n				\n					<li class="post-16033 product type-product status-publish has-post-thumbnail product_cat-core-add-ons product_cat-importexport pa_license-developer pa_license-personal virtual taxable shipping-taxable purchasable product-type-variable product-cat-core-add-ons product-cat-importexport has-default-attributes has-children instock">\n	<a href="https://wpjobmanager.com/add-ons/ziprecruiter-integration/">\n	</a><a href="https://wpjobmanager.com/add-ons/ziprecruiter-integration/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2015/11/ziprecruiter.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="ziprecruiter" /></a>\n\n	<h2>\n	<span class="price"><span class="amount">$29</span></span>\n <a href="https://wpjobmanager.com/add-ons/ziprecruiter-integration/">ZipRecruiter Integration</a></h2>\n\n	<p>Backfill your job board from ZipRecruiter. Query and display sponsored results alongside your own jobs, or list ZipRecruiter jobs via shortcodes.</p>\n</li>\n				\n					<li class="last post-6015 product type-product status-publish has-post-thumbnail product_cat-core-add-ons product_cat-importexport pa_license-developer pa_license-personal virtual taxable shipping-taxable purchasable product-type-variable product-cat-core-add-ons product-cat-importexport has-default-attributes has-children instock">\n	<a href="https://wpjobmanager.com/add-ons/careerbuilder-integration/">\n	</a><a href="https://wpjobmanager.com/add-ons/careerbuilder-integration/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2015/01/careerbuilder.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="careerbuilder" /></a>\n\n	<h2>\n	<span class="price"><span class="amount">$39</span></span>\n <a href="https://wpjobmanager.com/add-ons/careerbuilder-integration/">CareerBuilder Integration</a></h2>\n\n	<p>Backfill your job board from CareerBuilder. Query and display sponsored results alongside your own jobs, or list CareerBuilder jobs via shortcodes.</p>\n</li>\n				\n					<li class="first post-58 product type-product status-publish has-post-thumbnail product_cat-core-add-ons product_cat-importexport pa_license-developer pa_license-personal virtual sold-individually taxable shipping-taxable purchasable product-type-variable product-cat-core-add-ons product-cat-importexport has-default-attributes has-children instock">\n	<a href="https://wpjobmanager.com/add-ons/indeed-integration/">\n	</a><a href="https://wpjobmanager.com/add-ons/indeed-integration/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/edd/2014/02/indeed.png?resize=318%2C222&am