ley" class="item">\n		<img width="318" height="220" src="https://wpjobmanager.com/wp-content/uploads/2014/05/Product-Banner5.png?resize=318%2C220&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="Product-Banner5" /><span class="third_party">3rd Party</span>	</a>\n\n	<h2>\n	<span class="price"><span class="amount">$58</span> <small class="woocommerce-price-suffix">(excl. Tax)</small></span>\n <a href="http://themeforest.net/item/jobify-job-board-wordpress-theme/5247604?ref=mikejolley">Jobify Theme</a></h2>\n\n	<p>A Job Board WordPress Theme with full WP Job manager integration.</p>\n</li>\n				\n					<li class="post-13602 product type-product status-publish has-post-thumbnail product_cat-3rd-party product_cat-themes taxable shipping-taxable product-type-external product-cat-3rd-party product-cat-themes instock">\n	<a href="https://wpjobmanager.com/add-ons/babysitter/">\n	</a><a href="http://themeforest.net/item/babysitter-responsive-wordpress-theme/5702597?ref=mikejolley" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2015/08/screenshot.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="screenshot" /><span class="third_party">3rd Party</span>	</a>\n\n	<h2>\n	<span class="price"><span class="amount">$49</span> <small class="woocommerce-price-suffix">(excl. Tax)</small></span>\n <a href="http://themeforest.net/item/babysitter-responsive-wordpress-theme/5702597?ref=mikejolley">Babysitter</a></h2>\n\n	<p>A Job Board WordPress Theme for babysitters/nannies sites.</p>\n</li>\n				\n					<li class="last post-3564 product type-product status-publish has-post-thumbnail product_cat-3rd-party product_cat-themes taxable shipping-taxable product-type-external product-cat-3rd-party product-cat-themes instock">\n	<a href="https://wpjobmanager.com/add-ons/petsitter/">\n	</a><a href="http://themeforest.net/item/petsitter-job-board-responsive-wordpress-theme