al product-cat-3rd-party product-cat-free instock">\n	<a href="https://wpjobmanager.com/add-ons/ultimate-member-job-manager/">\n	</a><a href="https://wordpress.org/plugins/ultimate-member-job-manager/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2015/10/ultimate-member-job-manager-2.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="ultimate-member-job-manager-2" /><span class="third_party">3rd Party</span>	</a>\n\n	<h2>\n <a href="https://wordpress.org/plugins/ultimate-member-job-manager/">Ultimate Member Job Manager</a></h2>\n\n	<p>This plugin integrates WP Job Manager and its extensions into your Ultimate Member user profiles.</p>\n</li>\n				\n					<li class="post-16074 product type-product status-publish has-post-thumbnail product_cat-3rd-party taxable shipping-taxable product-type-external product-cat-3rd-party instock">\n	<a href="https://wpjobmanager.com/add-ons/ultimate-member-my-resume/">\n	</a><a href="http://shop.opentuteplus.com/product/ultimate-member-my-resume/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2015/10/ultimate-member-job-manager-2.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="ultimate-member-job-manager-2" /><span class="third_party">3rd Party</span>	</a>\n\n	<h2>\n	<span class="price"><span class="amount">$19</span> <small class="woocommerce-price-suffix">(excl. Tax)</small></span>\n <a href="http://shop.opentuteplus.com/product/ultimate-member-my-resume/">Ultimate Member My Resume</a></h2>\n\n	<p>Displays your latest resume in Ultimate Member user profiles.</p>\n</li>\n				\n					<li class="last post-18616 product type-product status-publish has-post-thumbnail product_cat-3rd-party taxable shipping-taxable product-type-external product-cat-3rd-party instock">\n	<a href="https://wpjobmanager.com/add-ons/buddypress-my-resume/">\n	</a><a href="https://shop.opentuteplus.com/product/buddypress-my-resume/" class="item">\n		<img width="318" height="222" src="https://wpjobmanager.com/wp-content/uploads/2016/02/buddypress-my-resume.png?resize=318%2C222&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="BuddyPress My Resume" /><span class="third_party">3rd Party</span>	</a>\n\n	<h2>\n	<span class="price"><span class="amount">$19</span> <small class="woocommerce-price-suffix">(excl. Tax)</small></span>\n <a href="https://shop.opentuteplus.com/product/buddypress-my-resume/">BuddyPress My Resume</a></h2>\n\n	<p>This plugin displays your latest resume in BuddyPress user profiles.</p>\n</li>\n				\n					<li class="first post-16075 product type-product status-publish has-post-thumbnail product_cat-3rd-party product_cat-themes taxable shipping-taxable product-type-external product-cat-3rd-party product-cat-themes instock">\n	<a href="https://wpjobmanager.com/add-ons/workscout/">\n	</a><a href="http://themeforest.net/item/workscout-job-board-wordpress-theme/13591801" class="item">\n		<img width="318" height="220" src="https://wpjobmanager.com/wp-content/uploads/2015/11/Product-Banner5.png?resize=318%2C220&amp;ssl=1" class="attachment-shop_catalog size-shop_catalog wp-post-image" alt="WorkScout" /><span class="third_party">3rd Party</span>	</a>\n\n	<h2>\n	<span class="price"><span class="amount">$59</span> <small class="woocommerce-price-suffix">(excl. Tax)</small></span>\n <a href="http://themeforest.net/item/workscout-job-board-wordpress-theme/13591801">WorkScout</a></h2>\n\n	<p>Redefining job boards for WordPress.</p>\n</li>\n				\n			</ul>', 'no'),
