(10, 1, '2015-09-23 08:50:11', '2015-09-23 08:50:11', '[submit_job_form]\r\n\r\n\r\n<h5>Support Best-In-Business</h5>\r\nWe live by making our clients happy and if you had anything less than a great experience with this theme please contact us now.\r\n\r\n\r\n<h5>Any other questions we can answer?</h5>\r\nWe are happy to help you. <a href="#">Contact us</a>\r\n</div>\r\n\r\n<hr />', 'Add Your Listing', 'Get more exposure.', 'publish', 'closed', 'closed', '', 'add-listing', '', '', '2016-03-02 08:10:26', '2016-03-02 08:10:26', '', 0, 'https://pixelgrade.com/demos/listable-stock/?page_id=10', 0, 'page', '', 0),
(91, 1, '2015-10-12 14:27:46', '2015-10-12 14:27:46', '<p class="intro" style="text-align: left;">Tradie List provides you with a set of tools to showcase your business and connect to your local community. Beautiful, simple and easy to use, Tradie List is a place to communicate with your customers.</p>\r\n\r\n\r\n<hr class="clear" />\r\n\r\n<img class="alignleft size-full wp-image-953" src="http://listable.com.au/wp-content/uploads/2016/03/help1.png" alt="how-it-works-1" width="401" height="310" />\r\n<h3>1. Add or Claim your Listing</h3>\r\nUpload photos, add helpful links to your website or to social media, set an address and hours of operation and other informations that you may find relevant.\r\n\r\n<a href="http://listable.com.au/listings/total-co-ordination/">See How a Claimed Listings Looks →</a>\r\n\r\n<hr class="clear" />\r\n\r\n<img class="alignright size-full wp-image-954" src="http://listable.com.au/wp-content/uploads/2016/03/help2.png" alt="how-it-works-2" width="400" height="324" />\r\n<h3>2. Get Discovered by Visitors</h3>\r\nUpon confirmation, your listing will appear throughout the site and will be searchable by visitors interested in your trade and area. A badge will be added to your listing to mark it as official.\r\n\r\n<a href="https://listable.com.au/listings-no-map/">Find and Claim Your Business →</a>\r\n\r\n<hr class="clear" />\r\n\r\n<img class="alignleft size-full wp-image-955" src="http://listable.com.au/wp-content/uploads/2016/03/help3.png" alt="how-it-works-3" width="401" height="304" />\r\n<h3>3. Increase your earnings</h3>\r\nOnce discovered, customers will start coming to you! It’s your job from here to make them happy and to leave positive reviews. Tradie List makes it easier for your customers to connect.\r\n\r\n<a href="http://listable.com.au/add-listing/">It''s absolutely free to list →</a>\r\n\r\n<hr class="clear" />\r\n\r\n&nbsp;\r\n<p class="description">Ready to reach all of the people who matter most to your business?</p>\r\n<a class="btn fullwidth" href="http://listable.com.au/add-listing/">Add Your Lising Now</a>', 'Connect with Local Work', 'Add your business to Tradie List, so customers can easily find it.', 'publish', 'closed', 'closed', '', 'how-it-works', '', '', '2016-03-02 06:57:11', '2016-03-02 06:57:11', '', 0, 'https://pixelgrade.com/demos/listable-stock/?page_id=91', 0, 'page', '', 0),
