(326, 1, '2015-10-10 06:57:11', '2015-10-10 06:57:11', 'When you invest your time, you make a goal and a decision of something that you want to accomplish. Whether it''s make good grades in school, be a good athlete, <strong>be a good person</strong>, go down and do some community service and help somebody who''s in need, whatever it is you choose to do, you''re investing your time in that.\n\nBeing in a community, from a scientific perspective, we are constituted so that simple acts of kindness, such as giving to charity or expressing gratitude, have a positive effect on our long-term moods. The key to the <strong>happy life</strong>, it seems, is the good life: a life with sustained relationships, challenging work, and connections to community.\n\n[gallery columns="2" link="file" size="full"  ids="11033,11035"]\n\nThis got me wondering about <a href="#">coffee</a> and <a href="#">beer</a> and which one would actually help me be more creative and get work done. Hopefully, this will help you decide when it’s best to have that triple shot espresso or ice cold brew.\n<blockquote>Every successful individual knows that his or her achievement depends on a community of persons working together.</blockquote>\nSolitude is very different from a ''time-out'' from our busy lives. Solitude is the very ground from which community grows.\n\n<a href="https://pixelgrade.com/demos/listable-stock/wp-content/uploads/2015/11/05_listable_demo.jpg"><img class="alignnone size-full wp-image-336" src="https://pixelgrade.com/demos/listable-stock/wp-content/uploads/2015/11/07_listable_demo.jpg" alt="Death_to_stock_photography_community_premium_4" width="1800" height="1200" /></a>\n\n[gallery size="full" columns="2" link="file"  ids="11036,11037"]\n\nWhen you invest your time, you make a goal and a decision of something that you want to accomplish.  Whenever we pray alone, study, read, write, or simply spend quiet time away from the places where we interact with each other directly, we are potentially opened for a deeper intimacy with each other.', 'The Annual Gathering Comunity', 'A place for the community to share and discuss their experiences', 'publish', 'open', 'open', '', 'the-biggest-annual-gathering-comunity', '', '', '2015-10-10 06:57:11', '2015-10-10 06:57:11', '', 0, 'https://pixelgrade.com/demos/listable-stock/?p=326', 0, 'post', '', 0),
(345, 1, '2015-08-28 07:26:46', '2015-08-28 07:26:46', 'When this happens, normally I grab a coffee to help get the ideas flowing, but for the last few days in Montreal, no one’s been allowed to drink the water due to a bacteria leakage, which also means, no coffee.\n\nTiny women carry amazingly large bags, twice their eighty-pound weight. Some of the women carry babies in slings around front. A good adult picker can harvest over two hundred pounds of cherries and earn $8 a day, more than twice the Guatemalan minimum daily wage.\n<h4>What is creativity really?</h4>\nFrom a scientific perspective, creativity is your ability to think of something original from connections made between pre-existing ideas in your brain. These connections are controlled by neurotransmitters like adenosine, which alerts your brain when you’re running out of energy and reacts.\n\nThis got me wondering about coffee and beer and which one would actually help me be more creative and get work done. Hopefully, this will help you decide when it’s best to have that triple shot espresso or ice cold brew.\n<blockquote>Adenosine is kind of like your brain’s battery status monitor.</blockquote>\nFrom a scientific perspective, creativity is your ability to think of something original from connections made between pre-existing ideas in your brain. These connections are controlled by neurotransmitters like adenosine, which alerts your brain when you’re running out of energy and reacts.\n<h4>Your brain on coffee</h4>\nEvery coffee drinker is familiar with the feelings after drinking a fresh cup of java. I know after I’ve had a latte or espresso, I feel more focused. If I’m having a conversation with someone, <strong>words seem to flow</strong> without pauses, ums, or ahs.\n\n<img class="alignnone size-full wp-image-346" src="https://pixelgrade.com/demos/listable-stock/wp-content/uploads/2015/11/08_listable_demo.jpg" alt="IMG_4415" width="1600" height="1067" />\n\nIf you decide to drink coffee or beer while you’re working, stick to no more than 2 drinks per sitting and try not to do this more than once or twice per week to prevent dependency. Coffee and beer shouldn’t be thought of as magic bullets for <a href="#">creativity</a>.\n<h4>Be Grateful.</h4>\nIt’s really simple. What is one thing today you are really grateful for? What is another? If you can list 3 things a day, you’ll see you have much more going for you than you thought. Soon your list will get so long you’ll be beaming with energy.\n<ol>\n	<li>Coffee and beer shouldn’t be thought of as magic bullets for creativity.</li>\n	<li>They are ways to create chemical changes that occur naturally in your body.</li>\n	<li>Quality sleep, a healthy diet, and allowing yourself to take breaks.</li>\n</ol>\nWe are all human as well and humans are not perfect creatures. When you learn to accept yourself, true happiness quickly arises.\n\nAll images are under copyright © <a href="http://laurentnivalle.fr">Laurent Nivalle</a>', 'The Modern Art of Coffee', '', 'publish', 'open', 'open', '', 'the-modern-art-of-coffee', '', '', '2015-08-28 07:26:46', '2015-08-28 07:26:46', '', 0, 'https://pixelgrade.com/demos/listable-stock/?p=345', 0, 'post', '', 0),
