(11151, 1, '2016-03-02 04:50:02', '2016-03-02 04:50:02', '<p class="p1"><span class="s1">Superior Hot Water Solutions will provide you with all your hot water needs without breaking the budget. </span><span class="s1">Our hot water solutions are energy-efficient to help reduce your energy bill while still enjoying the benefits of having hot water available anytime. We offer a variety of solutions such as a heat pump system, gas instalment, solar solutions and an electric system. We take pride in using locally sourced alternatives for your hot water needs as our own way of supporting our local workers and economy. Our employees are all highly professional and extensively trained to provide you the best service possible and give expert recommendations should you need advice.</span></p>', 'Superior Hot Water Solutions', '', 'expired', 'closed', 'closed', '', 'superior-hot-water-solutions', '', '', '2016-04-02 10:04:24', '2016-04-02 10:04:24', '', 0, 'http://tradielist.com.au/?post_type=job_listing&#038;p=11151', 0, 'job_listing', '', 0),
