(11161, 1, '2016-03-02 04:51:13', '2016-03-02 04:51:13', '<p class="p1"><span class="s1">Superior Hot Water Solutions will provide you with all your hot water needs without breaking the budget.</span></p>\n<p class="p1"><span class="s1">Our hot water solutions are energy-efficient. We want to help you reduce your energy bill while still enjoying the benefits of having hot water available anytime. We offer a variety of solutions such as a heat pump system, gas instalment, solar solutions and an electric system. We take pride in using locally sourced alternatives for your hot water needs as our own way of supporting our local workers and economy. Our employees are all highly professional and extensively trained to provide you the best service possible and give expert recommendations should you need advice.</span></p>', 'Superior Hot Water Solutions', '', 'inherit', 'closed', 'closed', '', '11151-autosave-v1', '', '', '2016-03-02 04:51:13', '2016-03-02 04:51:13', '', 11151, 'http://tradielist.com.au/2016/03/02/11151-autosave-v1/', 0, 'revision', '', 0),
(11162, 1, '2016-03-02 06:02:56', '2016-03-02 06:02:56', '<p class="intro">Listable provides you with a smart set of tools to showcase your business and connect to your community. Beautiful, simple and easy to use, Listable is a fun and friendly place to hook up with your customers.</p>\r\n\r\n\r\n<hr class="clear" />\r\n\r\n<img class="alignleft size-full wp-image-953" src="https://pixelgrade.com/demos/listable-stock/wp-content/uploads/2015/11/05_listable_demo.jpg" alt="how-it-works-1" width="401" height="310" />\r\n<h3>1. Add or Claim your Listing</h3>\r\nUpload photos, add helpful links to your website or to social media, set an address and hours of operation and other informations that you may find relevant.\r\n\r\n<a href="https://pixelgrade.com/demos/listable-stock/listings/paesan/">See How a Claimed Listings Looks →</a>\r\n\r\n<hr class="clear" />\r\n\r\n<img class="alignright size-full wp-image-954" src="https://pixelgrade.com/demos/listable-stock/wp-content/uploads/2015/11/08_listable_demo.jpg" alt="how-it-works-2" width="400" height="324" />\r\n<h3>2. Get Discovered by Visitors</h3>\r\nUpon confirmation, your listing will appear throughout the website and will be searchable by visitors interested on similar places. A badge will be added to your listing to mark it as official.\r\n\r\n<a href="https://pixelgrade.com/demos/listable-stock/listings/">Find and Claim Your Business →</a>\r\n\r\n<hr class="clear" />\r\n\r\n<img class="alignleft size-full wp-image-955" src="https://pixelgrade.com/demos/listable-stock/wp-content/uploads/2015/11/11_listable_demo.jpg" alt="how-it-works-3" width="401" height="304" />\r\n<h3>3. Increase your earnings</h3>\r\nOnce discovered, customers will start coming to you! It’s your job from here to make them happy to leave positive reviews. That’s how Listable helps them make better spending decisions.\r\n\r\n<a href="https://pixelgrade.com/demos/listable-stock/add-listing/">Pricing and Plans →</a>\r\n\r\n<hr class="clear" />\r\n\r\n&nbsp;\r\n<p class="description">Ready to reach all of the people who matter most to your business?</p>\r\n<a class="btn fullwidth" href="http://listable.com.au/add-listing/">Add Your Lising Now</a>', 'Listable for Business', 'Add your business to Listable, so customers can easily find it.', 'inherit', 'closed', 'closed', '', '91-revision-v1', '', '', '2016-03-02 06:02:56', '2016-03-02 06:02:56', '', 91, 'http://tradielist.com.au/2016/03/02/91-revision-v1/', 0, 'revision', '', 0),
(11164, 1, '2016-03-02 06:07:49', '2016-03-02 06:07:49', 'All images viewed in this live preview are for<strong> demo purposes only </strong>and are <strong>not included</strong> anywhere in the downloaded package or in the demo data import. The listings images and content excerpts come from their respective owners, which we mentioned on each page.\n<h3>Copyright Infringement</h3>\nIf you believe that your work has been copied in a way that constitutes a copyright infringement or if you do not agree to showcase your business on this demo site, please contact us now at <a href="mailto:george.olaru@pixelgrade.com">george.olaru@pixelgrade.com</a> and we will remove them immediately.', 'Permissions and Copyright', '-', 'inherit', 'closed', 'closed', '', '981-revision-v1', '', '', '2016-03-02 06:07:49', '2016-03-02 06:07:49', '', 981, 'http://tradielist.com.au/2016/03/02/981-revision-v1/', 0, 'revision', '', 0),
