(11205, 1, '2016-03-02 08:03:38', '2016-03-02 08:03:38', '[submit_job_form]\r\n<div class="twocolumn">\r\n<h5>100% Money Back Guarantee</h5>\r\nYou have 14 days of test–driving and if you''re unhappy with it, for any reason, just drop us an email and we''ll take care of you.\r\n<h5>Support Best-In-Business</h5>\r\nWe live by making our clients happy and if you had anything less than a great experience with this theme please contact us now.\r\n\r\n</div>\r\n\r\n<hr />\r\n\r\n<div class="twocolumn">\r\n<h5>Can I cancel my subscription?</h5>\r\nYes, you can cancel and perform other actions on your subscriptions via the My Account page.\r\n<h5>Which payment methods do you take?</h5>\r\nWooCommerce comes bundled with PayPal (for accepting credit card and PayPal account payments), BACS, and cash on delivery for accepting payments.\r\n<h5>Is there any discount for an annual subscription?</h5>\r\nYes, we offer a 40% discount if you choose annual subscription for any plan.\r\n<h5>Any other questions we can answer?</h5>\r\nWe are happy to help you. <a href="#">Contact us</a>\r\n\r\n</div>', 'Add Your Listing', 'Get more exposure.', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2016-03-02 08:03:38', '2016-03-02 08:03:38', '', 10, 'http://tradielist.com.au/2016/03/02/10-revision-v1/', 0, 'revision', '', 0),
