(11253, 1, '2016-03-03 06:25:51', '2016-03-03 06:25:51', 'Metro Landscape &amp; Irrigation Pty Ltd was established in 2000 when a partnership was formed between Steven Lovett and Mark Barnard. They have been constructing quality Melbourne gardens since 1989. Metro Landscape &amp; Irrigation have the formal qualification, experience and expertise to ensure the successful project management and construction of your garden. Our focus is on any size residential and small commercial gardens of Melbourne.\r\n\r\nMetro Landscape &amp; Irrigation consistently seeks to meet the high standards set via an architect’s or clients brief. We have constructed many gardens designed by some of Melbourne’s leading architects including Jack Merlo Design, Laidlaw and Laidlaw Design and Aktis pty ltd. We have also constructed award winning gardens at the Melbourne International Flower and Garden Show.', 'Metro Landscape &amp; Irrigation', '', 'expired', 'closed', 'closed', '', 'metro-landscape-irrigation', '', '', '2016-04-04 10:09:26', '2016-04-04 10:09:26', '', 0, 'http://tradielist.com.au/?post_type=job_listing&#038;p=11253', -1, 'job_listing', '', 0),
