(11264, 1, '2016-03-04 23:58:47', '2016-03-04 23:58:47', 'It’s simple really; we provide a professional service of rubbish removal experts dedicated to clearing rubbish of all types and sizes. Whether it’s your old mattress you’re struggling to shift, a building contractor needing rubble cleared quick time, or a business owner needing regular rubbish removal — we can help you with that.', 'Cheapest Load Of Rubbish', '', 'expired', 'closed', 'closed', '', 'cheapest-load-of-rubbish', '', '', '2016-04-04 10:09:26', '2016-04-04 10:09:26', '', 0, 'http://tradielist.com.au/?post_type=job_listing&#038;p=11264', 0, 'job_listing', '', 0),
