(11279, 1, '2016-03-22 00:13:11', '2016-03-22 00:13:11', 'I have extensive experience in the plumbing trade and have been exposed to it at a very young age. Within those years, I have handled a wide range of projects, both small and large. This, in turn, has equipped me with the needed skills and mindset to handle new and more sophisticated challenges.\r\n\r\nIn terms of workmanship, I also give my best to every project. I do not rest until my clients'' needs are met. Aside from this, I use only quality materials to ensure the durability of the project.\r\n\r\nI also offer the best quotes in the west. This is made possible by my low overheads. Rest assured, every job is done at the highest standards. I make it a point that the clients get the best value for the price they will pay.\r\n\r\nAnother fact that sets me apart is my excellent customer service. I treat my clients with respect and courtesy at all times, both in the office and on the job site. I come on time and finish the job on time as well. I am very professional and give out prompt responses to any questions or concerns.', 'Andrew Zahra Plumbing', '', 'expired', 'open', 'closed', '', 'andrew-zahra-plumbing', '', '', '2016-04-21 05:22:16', '2016-04-21 05:22:16', '', 0, 'http://tradielist.com.au/?post_type=job_listing&#038;p=11279', 0, 'job_listing', '', 0),
