(11282, 1, '2016-03-22 01:15:03', '0000-00-00 00:00:00', '<table border="0" width="100%">\n<tbody>\n<tr>\n<td rowspan="3" width="73%">Bendigo Regional Plumbing are conveniently located at 1 Homebush Drive in Junorton. We have years of experience when it comes to residential and commercial plumbing as well as a large range of Services that are listed below. Like our Facebook page to see our current specials.\n\nOur plumbers are constantly being trained to ensure that we can get the job done without you having to worry.\n\nBendigo Regional Plumbing are the perfect choice when it comes to service or replacement and offer a free quotation.</td>\n</tr>\n</tbody>\n</table>', 'Bendigo Regional Plumbing', '', 'draft', 'open', 'closed', '', '', '', '', '2016-03-22 01:15:03', '2016-03-22 01:15:03', '', 0, 'http://tradielist.com.au/?post_type=job_listing&#038;p=11282', 0, 'job_listing', '', 0);
